/*==================================================
AllCampusesView.js

The Views component is responsible for rendering web page with data provided by the corresponding Container component.
It constructs a React component to display all campuses.
================================================== */
import PropTypes from "prop-types";
import { Link } from "react-router-dom";

const AllCampusesView = (props) => {
  // If there are no campuses, display a message
  if (!props.allCampuses.length) {
    return (
      <div style={styles.container}>
        <h1 style={styles.title}>All Campuses</h1>
        <div style={styles.noDataMessage}>There are no campuses.</div>
        <br />
        <Link to={`/addcampus`}>
          <button style={styles.addButton}>Add New Campus</button>
        </Link>
      </div>
    );
  }

  // Sort campuses by ID in ascending order before rendering
  const sortedCampuses = [...props.allCampuses].sort((a, b) => a.id - b.id);

  // If there are campuses, render the list
  return (
    <div style={styles.container}>
      <h1 style={styles.title}>All Campuses</h1>
      {sortedCampuses.map((campus) => (
        <div key={campus.id} style={styles.card}>
          <Link to={`/campus/${campus.id}`} style={styles.link}>
            <h2 style={styles.campusName}>{campus.name}</h2>
          </Link>
          <h4 style={styles.campusId}>Campus ID: {campus.id}</h4>
          <p style={styles.campusAddress}>{campus.address}</p>
          <p style={styles.campusDescription}>{campus.description}</p>
          {/* Delete Campus Button */}
          <button
            style={styles.deleteButton}
            onClick={() => props.deleteCampus(campus.id)}
          >
            Delete Campus
          </button>
        </div>
      ))}
      <br />
      {/* Add New Campus Button */}
      <Link to={`/addcampus`}>
        <button style={styles.addButton}>Add New Campus</button>
      </Link>
      <br />
    </div>
  );
};

// CSS Styles
const styles = {
  container: {
    padding: "20px",
    backgroundColor: "#f5f5f5", // Light background
    minHeight: "100vh",
  },
  title: {
    fontFamily: "'Arial', sans-serif",
    fontWeight: "bold",
    fontSize: "36px",
    color: "#333333",
    textAlign: "center",
    marginBottom: "20px",
  },
  card: {
    backgroundColor: "#ffffff",
    borderRadius: "10px",
    padding: "20px",
    margin: "20px 0",
    boxShadow: "0px 4px 6px rgba(0, 0, 0, 0.1)", // Subtle shadow
  },
  campusName: {
    fontSize: "24px",
    fontWeight: "600",
    color: "#4a90e2", // Blue for campus name
    margin: "0 0 10px 0",
  },
  campusId: {
    fontSize: "16px",
    color: "#555555",
    margin: "0 0 10px 0",
  },
  campusAddress: {
    fontSize: "16px",
    color: "#333333",
    margin: "0 0 10px 0",
  },
  campusDescription: {
    fontSize: "14px",
    color: "#666666",
    margin: "0 0 10px 0",
  },
  link: {
    textDecoration: "none",
  },
  deleteButton: {
    backgroundColor: "#ff6b6b",
    color: "#ffffff",
    border: "none",
    borderRadius: "5px",
    padding: "10px 20px",
    fontSize: "14px",
    fontWeight: "bold",
    cursor: "pointer",
    transition: "all 0.3s ease",
    boxShadow: "0px 4px 6px rgba(0, 0, 0, 0.1)",
  },
  deleteButtonHover: {
    backgroundColor: "#ff4c4c", // Darker red on hover
  },
  addButton: {
    display: "block",
    margin: "20px auto",
    backgroundColor: "#4a90e2",
    color: "#ffffff",
    border: "none",
    borderRadius: "5px",
    padding: "10px 20px",
    fontSize: "16px",
    fontWeight: "bold",
    cursor: "pointer",
    transition: "all 0.3s ease",
    boxShadow: "0px 4px 6px rgba(0, 0, 0, 0.1)",
  },
  addButtonHover: {
    backgroundColor: "#357ABD", // Darker blue on hover
  },
  noDataMessage: {
    textAlign: "center",
    fontSize: "16px",
    color: "#777777",
  },
};

// Prop Types Validation
AllCampusesView.propTypes = {
  allCampuses: PropTypes.array.isRequired,
  deleteCampus: PropTypes.func.isRequired,
};

export default AllCampusesView;
